"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[8256],{4492:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Wiki Unit Electronics","href":"/wiki_uelectronics/docs/intro","docId":"intro","unlisted":false},{"type":"category","label":"UNIT - Development boards","collapsible":true,"collapsed":true,"items":[{"type":"category","label":"ESP-IDF Compatibility","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"ESP-IDF Installation and Usage Guide","href":"/wiki_uelectronics/docs/Development_boards/esp-idf/getting","docId":"Development_boards/esp-idf/getting","unlisted":false}],"href":"/wiki_uelectronics/docs/category/esp-idf-compatibility"},{"type":"category","label":"Compatibility with Arduino IDE & Micropython","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Unit Electronics Package Installation Guide","href":"/wiki_uelectronics/docs/Development_boards/Compatibility_Arduino_upython/Arduino","docId":"Development_boards/Compatibility_Arduino_upython/Arduino","unlisted":false},{"type":"link","label":"Micropython Compatibility Guide","href":"/wiki_uelectronics/docs/Development_boards/Compatibility_Arduino_upython/upython","docId":"Development_boards/Compatibility_Arduino_upython/upython","unlisted":false}],"href":"/wiki_uelectronics/docs/category/compatibility-with-arduino-ide--micropython"},{"type":"category","label":"DualMCU Development boards","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"DualMCU","href":"/wiki_uelectronics/docs/Development_boards/DualMCU/","docId":"Development_boards/DualMCU/DualMCU","unlisted":false},{"type":"link","label":"DualMCU ONE","href":"/wiki_uelectronics/docs/Development_boards/DualMCU/DualMCU_ONE","docId":"Development_boards/DualMCU/DualMCU_ONE","unlisted":false}],"href":"/wiki_uelectronics/docs/category/dualmcu-development-boards"},{"type":"category","label":"Nano Development boards","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Nano C6","href":"/wiki_uelectronics/docs/Development_boards/Nano/nano_c6","docId":"Development_boards/Nano/nano_c6","unlisted":false}],"href":"/wiki_uelectronics/docs/category/nano-development-boards"},{"type":"link","label":"Cocket Nova","href":"/wiki_uelectronics/docs/Development_boards/cocket_nova","docId":"Development_boards/cocket_nova","unlisted":false}],"href":"/wiki_uelectronics/docs/category/unit---development-boards"},{"type":"category","label":"UNIT - Modules","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Haptic Motor Driver Module","href":"/wiki_uelectronics/docs/Modules/haptic_motor_driver","docId":"Modules/haptic_motor_driver","unlisted":false},{"type":"link","label":"LiPo Charger Boost & I2C Monitor","href":"/wiki_uelectronics/docs/Modules/lipo_module","docId":"Modules/lipo_module","unlisted":false},{"type":"link","label":"Lumiknob Module","href":"/wiki_uelectronics/docs/Modules/lumiknob","docId":"Modules/lumiknob","unlisted":false},{"type":"link","label":"QWIIC RPI Module","href":"/wiki_uelectronics/docs/Modules/qwiic_rpi","docId":"Modules/qwiic_rpi","unlisted":false},{"type":"link","label":"Unit QWIIC BUS Module","href":"/wiki_uelectronics/docs/Modules/qwiic_bus","docId":"Modules/qwiic_bus","unlisted":false},{"type":"link","label":"unit_proto_power_delivery_decoy_ch224k","href":"/wiki_uelectronics/docs/Modules/proto_power_delivery_decoy","docId":"Modules/proto_power_delivery_decoy","unlisted":false}],"href":"/wiki_uelectronics/docs/category/unit---modules"},{"type":"category","label":"UNIT - Accessories","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"PAM8403 Audio Amplifier 3W","href":"/wiki_uelectronics/docs/Accessories/ampli","docId":"Accessories/ampli","unlisted":false}],"href":"/wiki_uelectronics/docs/category/unit---accessories"},{"type":"category","label":"UNIT - Firmware","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"UF2 Examples for DualMCU RP2040","href":"/wiki_uelectronics/docs/Firmware/UF2_Firmware","docId":"Firmware/UF2_Firmware","unlisted":false},{"type":"link","label":"Firmware Documentation","href":"/wiki_uelectronics/docs/Firmware/coketo","docId":"Firmware/coketo","unlisted":false}],"href":"/wiki_uelectronics/docs/category/unit---firmware"},{"type":"link","label":"Development  boards Resources","href":"/wiki_uelectronics/docs/custom","docId":"custom","unlisted":false},{"type":"link","label":"Frequently Asked Questions (FAQ)","href":"/wiki_uelectronics/docs/FAQ","docId":"FAQ","unlisted":false}]},"docs":{"Accessories/ampli":{"id":"Accessories/ampli","title":"PAM8403 Audio Amplifier 3W","description":"The UNIT PAM8403 Audio Amplifier 3W is a Class D audio amplification module designed to deliver up to 3W per channel of stereo output with high efficiency. It is ideal for portable audio applications and projects with low-power devices, such as music players, portable speakers, and battery-powered systems.","sidebar":"tutorialSidebar"},"custom":{"id":"custom","title":"Development  boards Resources","description":"Downloads","sidebar":"tutorialSidebar"},"Development_boards/cocket_nova":{"id":"Development_boards/cocket_nova","title":"Cocket Nova","description":"Explore the amazing features of the Cocket Nova development board, which runs on the CH552G microcontroller. This handy board makes it easy to kickstart your embedded projects.","sidebar":"tutorialSidebar"},"Development_boards/Compatibility_Arduino_upython/Arduino":{"id":"Development_boards/Compatibility_Arduino_upython/Arduino","title":"Unit Electronics Package Installation Guide","description":"This guide provides step-by-step instructions for installing the necessary board support packages to program the DualMCU-ONE/DualMCU (RP2040 + ESP32) and Cocket Nova CH552 development boards using the Arduino IDE. These packages enable development within the Arduino environment, ensuring smooth integration with your hardware.","sidebar":"tutorialSidebar"},"Development_boards/Compatibility_Arduino_upython/upython":{"id":"Development_boards/Compatibility_Arduino_upython/upython","title":"Micropython Compatibility Guide","description":"Cocket Nova CH552 is not supported by MicroPython","sidebar":"tutorialSidebar"},"Development_boards/DualMCU/DualMCU":{"id":"Development_boards/DualMCU/DualMCU","title":"DualMCU","description":"The Unit DualMCU board integrates the Raspberry Pi RP2040 microcontroller and the Espressif ESP32 WROOM chip into a single module, allowing you to make the most of the 32-bit dual-core ARM\xae Cortex\xae-M0+ processor to develop Internet of Things (IoT) projects with Bluetooth\xae and Wi-Fi connectivity.","sidebar":"tutorialSidebar"},"Development_boards/DualMCU/DualMCU_ONE":{"id":"Development_boards/DualMCU/DualMCU_ONE","title":"DualMCU ONE","description":"The UNIT DualMCU-ONE is a highly versatile development board that integrates the power of two microcontrollers: the ESP32 and the RP2040. Designed for advanced IoT, robotics, and industrial applications, it offers enhanced connectivity, robust power management, and full compatibility with Arduino UNO shields.","sidebar":"tutorialSidebar"},"Development_boards/esp-idf/getting":{"id":"Development_boards/esp-idf/getting","title":"ESP-IDF Installation and Usage Guide","description":"Official Documentation","sidebar":"tutorialSidebar"},"Development_boards/Nano/nano_c6":{"id":"Development_boards/Nano/nano_c6","title":"Nano C6","description":"We are currently working on the design of this new development board, UNIT NANO C6, at UNIT Electronics. Stay tuned for upcoming updates, including the schematic and future iterations. Our goal is to provide comprehensive resources that support the use and development with the UNIT NANO C6.","sidebar":"tutorialSidebar"},"FAQ":{"id":"FAQ","title":"Frequently Asked Questions (FAQ)","description":"This section answers the most common questions about the installation and use of Unit Electronics development boards.","sidebar":"tutorialSidebar"},"Firmware/coketo":{"id":"Firmware/coketo","title":"Firmware Documentation","description":"Welcome to the firmware documentation for the Coketo project. This section provides detailed information about the firmware used in our devices.","sidebar":"tutorialSidebar"},"Firmware/UF2_Firmware":{"id":"Firmware/UF2_Firmware","title":"UF2 Examples for DualMCU RP2040","description":"This repository provides UF2 (Universal Firmware Update) files specifically designed for the RP2040 microcontroller on the DualMCU board. These files enable users to easily load example firmware onto the board, facilitating customization and functionality updates. Various UF2 examples are included, allowing users to explore different capabilities and select the best fit for their needs.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Wiki Unit Electronics","description":"Introduction","sidebar":"tutorialSidebar"},"Modules/haptic_motor_driver":{"id":"Modules/haptic_motor_driver","title":"Haptic Motor Driver Module","description":"Haptic Motor Driver Module is a module that can be used to drive a haptic motor. The module is based on the DRV2605L haptic motor driver IC. The DRV2605L is a versatile haptic driver that can be used to drive a linear resonant actuator (LRA) or an eccentric rotating mass (ERM) motor, providing a wide range of haptic effects. The module is designed to be used with compatible STEMMA QT connectors and qwiic connectors.","sidebar":"tutorialSidebar"},"Modules/lipo_module":{"id":"Modules/lipo_module","title":"LiPo Charger Boost & I2C Monitor","description":"The UNIT LiPo Charger Boost & I2C Monitor is an advanced charging and monitoring module for single-cell LiPo batteries (3.7V to 4.2V). It integrates a TP4056 charger, an MT3608 voltage booster with output limited to 27V, and a MAX17048 battery monitor over I2C. This module is ideal for applications requiring efficient charging and real-time battery monitoring.","sidebar":"tutorialSidebar"},"Modules/lumiknob":{"id":"Modules/lumiknob","title":"Lumiknob Module","description":"The Module Potentiometer Interface SPI MAX7219 32 LED Sequential is a module that allows you to control 32 LEDs sequentially using a potentiometer. The module uses the SPI protocol to communicate with the MAX7219 LED driver, which controls the LEDs. The potentiometer is used to adjust the speed at which the LEDs are lit up.","sidebar":"tutorialSidebar"},"Modules/proto_power_delivery_decoy":{"id":"Modules/proto_power_delivery_decoy","title":"unit_proto_power_delivery_decoy_ch224k","description":"Overview","sidebar":"tutorialSidebar"},"Modules/qwiic_bus":{"id":"Modules/qwiic_bus","title":"Unit QWIIC BUS Module","description":"Description","sidebar":"tutorialSidebar"},"Modules/qwiic_rpi":{"id":"Modules/qwiic_rpi","title":"QWIIC RPI Module","description":"Description","sidebar":"tutorialSidebar"}}}}')}}]);